// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ShamirSecretSharing {
    uint256 public secret;
    address public owner;
    uint256 public remainingChunks;
    uint256 private _newSecret;
    uint256 private _currentChunk;
    uint256 private constant CHUNK_SIZE = 32; // 32 bytes (256 bits)

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    function setSecret(uint256 _secret) external onlyOwner {
        require(_secret != secret, "New secret must be different from the current one");

        _newSecret = _secret;
        remainingChunks = CHUNK_SIZE;

        _updateSecretChunk();
    }

    function _updateSecretChunk() private {
        require(remainingChunks > 0, "All chunks updated");

        uint256 startByte = (CHUNK_SIZE - remainingChunks) * 8;
        uint256 currentChunkData = (_newSecret >> startByte) & ((1 << 8 * CHUNK_SIZE) - 1);
        
        assembly {
            sstore(secret.slot, currentChunkData)
        }

        remainingChunks--;

        if (remainingChunks > 0) {
            _currentChunk++;
            if (_currentChunk % 50 == 0) { // Limiting the iterations per transaction to prevent gas exhaustion
                return;
            }
            _updateSecretChunk();
        }
    }
}

